import React from 'react';
import { css } from 'emotion'



const Article_Header = () => {
    return (
        <header className={styles.title_holder}>
            <h1 className={styles.title}>Moody - NLP sentiment analysis</h1>
            <h5 className={styles.description}> An overview of how I used a third party API to create a WebApp to analyze sentiments on any user input.</h5>
        </header>
    )
}


export default Article_Header;
